JOB OFFER
FRONTEND DEVELOPER
As a Frontend Developer, you will develop websites and e-commerce stores using Shopify and WordPress/Woocommerce technologies, in all phases of the product life cycle, as part of a high-performing and multi-disciplinary team.
You Will
Implement a design made by UX/UI designer on Adobe XD;
Develop Front-End components in order to improve responsiveness and overall performance;
Manage to test and debug and participate in quality assurance;
Participate in an agile project management system based on multiple sprints;
Propose ideas and lead initiatives to solve client’s needs;
Respond to a project manager and build a trusting relationship by keeping them informed on updates, blockers, and propose real doable deadlines;
Help proactively to solve problems, and give improvement suggestions within the Front-End team;
Participate in gathering meetings with a team of other developers, designers, e-commerce managers and contribute to the whole product building process;
Provide websites support by working on tweaks & fixes – based on monthly hour packs;
Ability to multitask effectively in a fast-paced environment;
Being proactive in searching for new ways of doing tasks and finding solutions for task delivery;
Must Have
Degree in Computer Engineering, Computer science, Information Systems or similar;
Must have Proficiency with HTML5, CSS, JavaScript, and PHP;
Previous Experience with other e-commerce projects;
Nice To Have
Proficiency with JavaScript frameworks; (React/AngularJS/VueJS), PHP Frameworks (Laravel/CodeIgniter), WordPress, DataBase (MySQL, MariaDB), API’s integration;
Experience using Click Up as a project management tool;

For Individual Applicants Only; No Third-Party Applications Will Be Considered!
Think of your favorite book from childhood. Got it? Great. Now, that warm, joyful feeling you have right now—that’s what we do
. Literati is a modern children’s book company focused on building reading skills so kids can grow to be their best selves. We make it easy to find books kids love through school book fairs,book clubs, and classrooms using a unique mix of expert curation and data science. We’re on a mission to help parents ignite a love of learning and a love of life.
About The Role
As a Senior Full Stack Engineer, you will be focused on supporting our consumer-facing systems for our classroom store and kids club products. You will play a crucial role in designing and building compelling user experiences in support of user acquisition and retention. You’ll be an essential part of the team that is helping to improve children’s literacy across the United States. As part of a small team there will be many opportunities for personal and career growth. You will also get the opportunity to work alongside some of the preeminent experts in the field of machine learning and personalization.
In this role you will be expected to work with product owners/managers across the company and participate in sprint grooming, planning, retrospective sessions. Working with your Engineering teammates, you’ll incorporate your expertise into our overall Engineering craft to achieve efficient delivery of our software products to market. Our Classroom store is a highly customized WooCommerce instance that supports thousands of bookfairs, teachers, and parents in their fundraising efforts. You will be supporting our efforts to improve their experience and expand our product offerings to help them raise more money.
Literati’s current stack (which you will help to define and evolve) includes terraform-driven provisioning in GCP, helm-driven kubernetes hosting for services, a mix of Django, nodejs, and wordpress application servers, and postgres databases in cloud SQL. We monitor using PagerDuty, DataDog, Sentry, and cloud logging.
Qualifications
5+ years experience defining and leading web application server architecture initiatives;
3+ years experience building web applications using PHP, particularly custom WordPress development;
Experience in API and Data Model design;
Experience with Front End technologies, including CSS and JavaScript Frameworks;
Ability to efficiently communicate architectural perspectives and monitor implementations;
Experience with developing tests that ensure performance, quality, and scalability;
Track record of successful delivery in an agile environment;
Demonstrated experience with common tools such as Git, Shortcut/Jira, etc.;
Demonstrated leadership abilities in an engineering environment by driving operational excellence and best practices and mentoring junior developers;
Requirements
Experience with custom Wordpress plugin development or Laravel 
Competency with React and/or Vue
Compensation
To be equitable to all Literatians, we have set compensation and a non-negotiation policy- we don't think a person’s pay should be determined by how comfortable they negotiate. As a result, we like to be transparent and up-front about the compensation. When we make an offer, we can provide options so that employees can choose between compensation packages that prioritize salary or equity. The salary band for this role will be between $140,000 - $150,000 depending on experience.
About Literati
Literati was recently named Inc. magazine’s 7th fastest growing company in Texas, the 77th fastest in the United States and included in Built In Austin’s 2022 & 2023 & 2024 Best Places to Work. Jessica Ewing, Literati’s Founder and CEO, was named one of “Google’s Top 12 Most Innovative Minds” by Fast Company. We’ve raised over $60M in venture capital to date, with key investors including Founders Fund, General Catalyst, Felicis,01A, and Stephen Curry’s SC30.
We offer competitive salaries, company equity, medical/dental/vision insurance, 401k, short-term disability insurance, parental leave, employee assistance programs, flexible work schedules, and untracked time off.
Compensation Range: $140K - $150K

Bring your heart to CVS Health. Every one of us at CVS Health shares a single, clear purpose: Bringing our heart to every moment of your health. This purpose guides our commitment to deliver enhanced human-centric health care for a rapidly changing world. Anchored in our brand — with heart at its center — our purpose sends a personal message that how we deliver our services is just as important as what we deliver.
Our Heart At Work Behaviors™ support this purpose. We want everyone who works at CVS Health to feel empowered by the role they play in transforming our culture and accelerating our ability to innovate and deliver solutions to make health care more personal, convenient and affordable.
Position Summary
Aetna Resources, LLC, a CVS Health company, is hiring for the following role in Irving, TX: Data Engineer to develop, build and manage large-scale data structures, pipelines and efficient Extract/Load/Transform (ETL) workflows to address complex problems and support business applications. Duties include: develop large scale data structures and pipelines to organize, collect and standardize data to generate insights and addresses reporting needs; write ETL (Extract/Transform/Load) processes, design database systems, and develop tools for real-time and offline analytic processing that improve existing systems and expand capabilities; collaborate with Data Science team to transform data and integrate algorithms and models into automated processes; test and maintain systems and troubleshoot malfunctions; leverage knowledge of Hadoop architecture, HDFS commands, and designing and optimizing queries to build data pipelines; utilize programming skills in Python, Java, or similar languages to build robust data pipelines and dynamic systems; build data marts and data models to support Data Science and other internal customers; integrate data from a variety of sources and ensure adherence to data quality and accessibility standards; analyze current information technology environments to identify and assess critical capabilities and recommend solutions to complex business problems; and experiment with available tools and advise on new tools to provide optimal solutions that meet the requirements dictated by the model/use case. Telecommuting available. Multiple Positions - Requirements: Master’s degree (or foreign equivalent) in Computer Science, Data Science, Statistics, Mathematics, Analytics, Information Technology and Management, or a related field and one (1) year of experience in the job offered or related occupation. Requires one (1) year of experience in each of the following:
 CI/CD;
 GIT;
 DevOps;
 Cloud technologies: Azure, or Amazon Web Services (AWS), or Google Cloud Platform (GCP);
 MySQL;
 Testing, quality assurance, and troubleshooting;
 SAS or SQL programming languages; and
 “Big data” platforms including Hadoop (Azure, GCP, or AWS).
Pay Range: 
$120890.00/year to $140000.00/year.
This pay range represents the base hourly rate or base annual full-time salary for all positions in the job grade within which this position falls. The actual base salary offer will depend on a variety of factors including experience, education, geography and other relevant factors. This position is eligible for a CVS Health bonus, commission or short-term incentive program in addition to the base pay range listed above. This position also includes an award target in the company’s equity award program.
In addition to your compensation, enjoy the rewards of an organization that puts our heart into caring for our colleagues and our communities. The Company offers a full range of medical, dental, and vision benefits. Eligible employees may enroll in the Company’s 401(k) retirement savings plan, and an Employee Stock Purchase Plan is also available for eligible employees. The Company provides a fully-paid term life insurance plan to eligible employees, and short-term and long term disability benefits. CVS Health also offers numerous well-being programs, education assistance, free development courses, a CVS store discount, and discount programs with participating partners. As for time off, Company employees enjoy Paid Time Off (“PTO”) or vacation pay, as well as paid holidays throughout the calendar year. Number of paid holidays, sick time and other time off are provided consistent with relevant state law and Company policies.
For more detailed information on available benefits, please visit jobs.CVSHealth.com/benefits
This job does not have an application deadline, as CVS Health accepts applications on an ongoing basis.
